import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route } from "react-router-dom";
import IntroPage from './components/IntroPage/IntroPage'
import QuestionsPage from "./components/QuestionsPage/QuestionsPage";
import DatePage from "./components/DatePage/DatePage";
import CompletionPage from "./components/CompletionPage/CompletionPage";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import PageHeader from './components/PageHeader/PageHeader';
import PageFooter from './components/PageFooter/PageFooter';

function App() {

  const components = [
    {path:"/", name:"IntroPage", componentClassName: IntroPage},
    {path:"/QuestionsPage", name:"QuestionsPage", componentClassName: QuestionsPage},
    {path:"/DatePage", name:"DatePage", componentClassName: DatePage},
    {path:"/CompletionPage", name:"CompletionPage", componentClassName: CompletionPage}
  ];


  return (
    <Router>
      <Container className='containerHeight'>
        <PageHeader components={components}/>
      </Container>
      <Container className='containerHeight'>
        <Row>
          <Col>
            {(() => {
              let routes = []
              console.log(components);
              for(var i=0; i < components.length; i++) {
                console.log(components[i].componentClassName);
                routes.push(
                  <div> {components[i].path} {components[i].componentClassName} </div>
                )
              }
              return routes;
            })()}
          </Col>
          <Col xs={12}>
            <Routes>
              {(() => {
                let routes = []
                console.log(components);
                for(var i=0; i < components.length; i++) {
                  routes.push(
                    <Route exact 
                    path={components[i].path} 
                    element={components[i].componentClassName} />
                  )
                }
                return routes;
              })()}
            </Routes>
          </Col>
          <Col>
          </Col>
        </Row>
      </Container>
      <Container>
        <PageFooter pageCount="5" index="2"/>
      </Container>
    </Router>
  );
}

export default App;
